import React from "react";

const Input = (props) => {

  return (
    <React.Fragment>
      <label htmlFor={props.labelFor}>{props.labelText}</label>
      <input
        type={props.inputType}
        id={props.inputId}
        value={props.inputValue}
        onChange={props.inputOnChange}
        onBlur={props.inputOnBlur}
      />
    </React.Fragment>
  )
}

export default Input;
